import Grid from '../components/grid/gridLayout';
import classes from '../layout.module.css';

const DUMMY_DATA = [
    {
        id: 'm1',
        title: 'himalya',
        imageURL: 'https://commons.wikimedia.org/wiki/File:Moun_N%C3%A9.jpg',
        description:
          'lorem dipsum',
        category: 'nature'  
      },
      {
        id: 'm2',
        title: 'himalya 2',
        imageURL: 'https://cdn.britannica.com/67/19367-050-885866B4/Valley-Taurus-Mountains-Turkey.jpg',
        description:
          'lorem dipsum',
          category: 'nature'  
      },
      {
        id: 'm2',
        title: 'bmw car',
        imageURL: 'https://mediapool.bmwgroup.com/cache/P9/201411/P90169551/P90169551-the-new-bmw-m6-coup-exterior-12-2014-600px.jpg',
        description:
          'lorem dipsum',
          category: 'car'  
      },  
]

function HomePage(){
    function naturefilterHandler(){
        const Filtered_DUMMY_DATA = DUMMY_DATA.filter(
            item => item.category.includes('nature'));
        console.log(Filtered_DUMMY_DATA);    
    }

    return (
        <section>
          <h1>All Photos</h1>
          <button className={classes.btn} onClick={naturefilterHandler}>
            Nature
          </button>
          <Grid items={DUMMY_DATA} />
        </section>
      );
}

export default HomePage
